script: |
  super -f text -I q5849.spq | sort > q5849.out

inputs:
  - name: q5849.spq
    data: |
      SELECT ALL col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT IN ( - col2, + col1, col0, col0 * col1 + + - col1 - 13 );
  - name: tab0

outputs:
  - name: q5849.out
    data: |
      10
      47
      99
